var characterHtmlPages_452985197 = [{data: [{Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -902394362, Field1: makeNimstrLit("ice_climbers"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1570547443, Field1: makeNimstrLit("cloud"), Field2: makeNimstrLit("<h2>General gameplan and tips</h2>\x0A<p>Our best opening we have vs Cloud is when he\xE2\x80\x99s off stage.\x0ATry getting him off stage, then killing him with bair.\x0AIf he\xE2\x80\x99s recovering low, we can dash attack 2 frame his up B almost always (even with limit up b).</p>\x0A<p>Play grounded, he can swat us out of the air very easily with huge hitboxes without thinking</p>\x0A<p>Make use of dash -&gt; shield and walk -&gt; shield to mess up his spacing, to give us openings to use up b oos</p>\x0A<p>Parry his fair/bair, then dash attack or grab</p>\x0A<p>If he\xE2\x80\x99s constantly using falling aerials, we can open him up with a pre-emptive up b, or fh nair</p>\x0A<h2>Getting out of the corner</h2>\x0A<ul>\x0A<li>If we\xE2\x80\x99re being pressured in the corner, don\xE2\x80\x99t jump</li>\x0A<li>Walk -&gt; shield is really good here</li>\x0A<li>Getting grabbed by cloud never matters, so don\'t worry about that here</li>\x0A<li>You can also up b through his shit in the corner because of our iframes, then just have to deal with landing</li>\x0A</ul>\x0A<h2>Ledge trapping</h2>\x0A<p>Chef at ledge is really good as it can force a jump from ledge. You can call out the jump with sh up air, which combos into up b, sending cloud back off stage.</p>\x0A<p>Cloud\xE2\x80\x99s up smash is huge, he can punish spaced landing bair on shield with up smash</p>\x0A<p>Cloud Neutral b can be absorbed by bucket, and bucket will kill at around 15%.</p>\x0A<h2>Cloud up b counterplay</h2>\x0A<ul>\x0A<li>Shield the rising hits, roll behind him, and charge down smash</li>\x0A<li>Shield the rising hits, spot dodge the falling hits, and down smash</li>\x0A<li>Shield rising hits, up b or up air him on the way down</li>\x0A<li>Shield rising hits, up smash him on the way down</li>\x0A</ul>\x0A<h2>Cloud side b counterplay:</h2>\x0A<p>If Cloud does a full side b on our shield, it\xE2\x80\x99s -24. We have just enough time to drop shield -&gt; dsmash</p>\x0A<p>If Cloud starts side b on our shield, we can roll behind him after the 2nd hit</p>\x0A<p>Cloud\xE2\x80\x99s limit side B can be parried easily for a free down smash</p>\x0A<p>Watch <a href=\"https://www.youtube.com/watch?v=kXROMJgX9J0\" target=\"_blank\">this video on how to spot dodge cloud side b</a>, it\xE2\x80\x99s really free</p>\x0A<h2>Bread and Butter kill confirm percents</h2>\x0A<ul>\x0A<li>Nair -&gt; Dtilt kills at 105% at ledge</li>\x0A<li>Nair -&gt; FTilt kills at 112% at ledge</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1419867376, Field1: makeNimstrLit("sephiroth"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -207789544, Field1: makeNimstrLit("kazuya"), Field2: makeNimstrLit("<h2>How to play neutral</h2>\x0A<h3>Do not Approach</h3>\x0A<ul>\x0A<li>Approaching is one of the main things you want to avoid vs kazuya since he can easily stuff out approaches like dash attack, grab and nair with moves such as back tilt and ewgf.</li>\x0A</ul>\x0A<h3>Camp/Play patiently</h3>\x0A<ul>\x0A<li>\x0A<p>Kazuya can stuff out our approaches, but we can stuff out his approaches too</p>\x0A</li>\x0A<li>\x0A<p>Chef is really good at dealing with kazuya approaching, him reflecting the bacons will be useless since it will just clank with the next bacon, cdc wouldn\'t work as there are times where it isn\'t invincible, and since chef has 5 long lasting hitboxes it will hit him</p>\x0A</li>\x0A<li>\x0A<p>Fair and bair are also decent tools vs kazuya. Keep in mind to be careful with your chefs as sometimes kazuya\'s will use neutral b to hit you, which goes through chef.</p>\x0A</li>\x0A<li>\x0A<p>When close to kaz try to avoid shielding as much as possible since ewgf just ignores shield, in general you just don\'t want to be near kaz, you have to play the MU similar to fighting Luigi at 0.</p>\x0A</li>\x0A</ul>\x0A<h2>Advantage is HUGE for us</h2>\x0A<ul>\x0A<li>Kazuya notoriously has a really bad disadvantage state and G&amp;W is very good at capitalizing off it.</li>\x0A<li>Kazuya gets juggled insanely hard as he has very few options to get down, his only real options are airdodge and down air, with down air being super easy to predict.</li>\x0A<li>You can also edgeguard kaz easily since his recovery is extremely linear, if he goes low aim to stage spike him with bair.</li>\x0A<li>Kazuya also gets ledgetrapped pretty hard, he doesn\'t have too many answers to chef.</li>\x0A</ul>\x0A<h2>Disadvantage</h2>\x0A<ul>\x0A<li>\x0A<p>G&amp;W is one of the harder characters for kaz to combo but he still has true confirms, most of the time you can try to sdi out or up b out of the combos, but it mainly comes down to the kazuya dropping the combo or not.</p>\x0A</li>\x0A<li>\x0A<p>If you\'re offstage you won\'t have to worry about getting edgeguarded, since it\'s risky to edgeguard G&amp;W in the first place and kaz isn\'t that great at edgeguarding. Drop down nair is risky as kaz has quite a few moves to combat it, ftilt, tombstone crusher, dragon uppercut to name a few so try to not use it too much.</p>\x0A</li>\x0A<li>\x0A<p>Most of the time just use the different getup options depending on what the kaz is doing, roll is a bit risky due to auto turn around though.</p>\x0A</li>\x0A</ul>\x0A<h2>What to do vs rage drive</h2>\x0A<ul>\x0A<li>\x0A<p>Against rage drive, avoid using chef as kaz can just armor right through it.</p>\x0A</li>\x0A<li>\x0A<p>Try to bait out the rage drive and punish with like a fair or ftilt, getting him offstage is also a good decision as it can setup for an edgeguard kill or kaz just getting ledgetrapped.</p>\x0A</li>\x0A<li>\x0A<p>While ledgetrapping, try to be careful with chef since after the 5th bacon he can just do regular getup into rage drive.\x0AFair is a good way to counter regular/getup attacks.</p>\x0A</li>\x0A</ul>\x0A")}, {Field0: -1818239464, Field1: makeNimstrLit("luigi"), Field2: makeNimstrLit("<h1>Win Conditions</h1>\x0A<ul>\x0A<li>Bait out grab</li>\x0A<li>Consistent edgeguards</li>\x0A<li>Juggling for damage</li>\x0A<li>Get offstage as much as possible</li>\x0A<li>Force to approach</li>\x0A</ul>\x0A<h1>Focus</h1>\x0A<ul>\x0A<li>Up Smash OoS/Up B OoS habits</li>\x0A<li>Recovery habits</li>\x0A<li>Grab Habits</li>\x0A<li>Watch my percents for grab confirms</li>\x0A<li>Down b to break combos. Bait and punish it.</li>\x0A</ul>\x0A<h1>Neutral</h1>\x0A<ul>\x0A<li>Keep away from him to try to bait out grab</li>\x0A<li>Platform camp to rack up damage past around 30</li>\x0A<li>Camp out at 0 to avoid 0-death</li>\x0A<li>Use anything to get him offstage</li>\x0A</ul>\x0A<h1>Disadvantage:</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Watch out for zair&gt;dair.</li>\x0A<li>will throw out active hit boxes to cover ledge options.</li>\x0A<li>Can\'t punish waiting effectivley except with zair.</li>\x0A<li>If dtilting or dash attacking ledge then drop down nair will work very well.</li>\x0A<li>Don\'t roll because of grabs, up b, dash attack, etc.</li>\x0A<li>Regular getup through zair then up b could work well.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Can keep you in the air with nair, upair, down b.</li>\x0A<li>Don\'t dair at high percents because of down b invincibility.</li>\x0A<li>Best to go offstage to recover.</li>\x0A<li>SDI and DI away to get out of combos.</li>\x0A</ul>\x0A<h1>Advantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Bacon works very well against him.</li>\x0A<li>Dash attack works well to keep him offstage and 2 frame up b.</li>\x0A<li>Dair can spike him with a 2frame.</li>\x0A<li>Ledgetrump nair or dair.</li>\x0A</ul>\x0A<h2>Offstage</h2>\x0A<ul>\x0A<li>Bair works very well. Beats out his side b, just watch out for misfires.</li>\x0A<li>Drag down nair and bair can get him low enough to force an option or to kill.</li>\x0A<li>Dair if you have a jump and are high enough if needed.</li>\x0A<li>If you misread an option go back to ledge to get jump back and go for more bairs.</li>\x0A<li>If he gets above you use up-b to get him further offstage.</li>\x0A<li>Nair and bair and dair to deal with low recoveries.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Bad disadvantage in the air. Abuse it with nair, upair, bair, up-b.</li>\x0A<li>Doesn\'t have many options aside from airdodging to get out of juggles.</li>\x0A<li>Catch landings with dash attack or bair.</li>\x0A<li>Airdodge is laggy and his best option so bait it out and nair it or bair it.</li>\x0A<li>Avoid getting too close because of down b. If he\'s fast falling then nair and if he\'s at a distance then up air.</li>\x0A</ul>\x0A<h1>Misc.</h1>\x0A<ul>\x0A<li>They\'re going to mash down b out of hitstun. Frame 1 invinicibilty.</li>\x0A<li>Watch out for zair, fireball, grab mixups.</li>\x0A<li>Don\'t touch his shield at all.</li>\x0A<li>Grab is pretty slow so he can\'t punish OoS at a distance too well.</li>\x0A</ul>\x0A<h1>Stages:</h1>\x0A<h2>Battlefield</h2>\x0A<ul>\x0A<li>Good for camping plats.</li>\x0A<li>Big blast zones.</li>\x0A</ul>\x0A<h2>Final Destination:</h2>\x0A<ul>\x0A<li>Always ban.</li>\x0A</ul>\x0A<h2>Town and City</h2>\x0A<ul>\x0A<li>Always ban.</li>\x0A</ul>\x0A<h2>Smashville:</h2>\x0A<ul>\x0A<li>Good stage overall. Camp under the platform with chef when at an advantage.</li>\x0A<li>Good platform to camp at 0%.</li>\x0A<li>Platform makes it harder for him to land. Easier to punish up-b.</li>\x0A</ul>\x0A<h2>Pokemon Stadium 2:</h2>\x0A<ul>\x0A<li>Pretty neutral. Okay to start here but wouldn\'t go back. Big blast zones help him more than they help me.</li>\x0A</ul>\x0A<h2>Yoshi\'s Story:</h2>\x0A<ul>\x0A<li>Can be okay for both sides. Both die earlier.</li>\x0A<li>Avoid it in general though because of down b, nair, and upair killing earlier.</li>\x0A</ul>\x0A<h2>Lylat:</h2>\x0A<ul>\x0A<li>Avoid heavily.</li>\x0A<li>Hard to break zone of aerials and grabs and zairs due to low platforms. Very hard to land and take stage control.</li>\x0A<li>Can gimp him so he probably won\'t take you there but always keep in mind.</li>\x0A<li>Ledges close to blastzones. Somewhat low ceiling.</li>\x0A</ul>\x0A<h2>Kalos:</h2>\x0A<ul>\x0A<li>Platforms good for edgeguarding.</li>\x0A<li>Can dair if he\'s close to the stage while offstage.</li>\x0A<li>Higher ceiling so down b and up b won\'t kill as early.</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -519537124, Field1: makeNimstrLit("bowser_jr"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -966922720, Field1: makeNimstrLit("young_link"), Field2: []}, {Field0: -1415198175, Field1: makeNimstrLit("jigglypuff"), Field2: makeNimstrLit("<h2>General gameplan</h2>\x0A<ul>\x0A<li>\x0A<p>Jigglypuff players like to play passive and campy this can be punished by fair spamming and up air spamming if they try to go over you</p>\x0A</li>\x0A<li>\x0A<p>Jigglypuff can\xE2\x80\x99t really beat G&amp;W\xE2\x80\x99s disjoints, so you should abuse fair and bair as much as possible</p>\x0A</li>\x0A<li>\x0A<p>A lot of Jigglypuff players like to use pound to approach to counter this. Make sure to keep your distance from puff and don\xE2\x80\x99t just jump straight into puff.</p>\x0A</li>\x0A<li>\x0A<p>Pound can be beaten by bair and fsmash. If you expect Puff to pound, dash back -&gt; fsmash is a good minimal risk punish that can kill puff at 70%</p>\x0A</li>\x0A<li>\x0A<p>Pound also combo\xE2\x80\x99s into soft fair into rest, so avoiding getting hit by pound at 26-40% is top priority\x0AFurthermore, pound -&gt; soft fair -&gt; rest can be avoided by di\xE2\x80\x99ing away on the pound</p>\x0A</li>\x0A<li>\x0A<p>Doing a random upsmash when a puff approaches is a good mixup, and can catch a stray puff aerial\x0AG&amp;W is such a cheater character that it\xE2\x80\x99s almost impossible for a puff to punish you for doing a random upsmash</p>\x0A</li>\x0A</ul>\x0A<h2>Dealing with puff offstage, dair loops, and recovering</h2>\x0A<ul>\x0A<li>\x0A<p>Jigglypuff is one of the few characters in the game where G&amp;W can struggle to edgeguard or even ledgetrap.\x0AIf Jigglypuff recovers low, using dair off stage can be a good punish, or just waiting for her to come to stage and ledgetrapping with chef can also be good</p>\x0A</li>\x0A<li>\x0A<p>If Jigglypuff recovers high, there\xE2\x80\x99s nothing G&amp;W can really do to stop her so just wait on stage and harass her with up airs when she tries coming back down</p>\x0A</li>\x0A<li>\x0A<p>You can escape jigglypuff dair loops by hard sdi\'ing up</p>\x0A</li>\x0A<li>\x0A<p>Jigglypuff has a confirm of dair into rest, so make sure to switch up which way your sdi\'ing up as to not get hit by rest</p>\x0A</li>\x0A<li>\x0A<p>If a Jigglypuff misses rest, use a charged upsmash to kill at 50% or later</p>\x0A</li>\x0A<li>\x0A<p>Jigglypuff is also one of the few characters that can actually punish G&amp;W up b.\x0AIf she uses pound at ledge, it will 2 frame G&amp;W up b every time. To counter this, use bucket to slow your fall to try and mix up when you\'re going to up b, so the puff will mess up the timing</p>\x0A</li>\x0A</ul>\x0A<h2>Bread and Butter kill confirm percents</h2>\x0A<ul>\x0A<li>\x0A<p>Nair -&gt; Ftilt will kill puff at 88% at ledge.</p>\x0A</li>\x0A<li>\x0A<p>Nair -&gt; Dtilt will kill puff at 80% at ledge (Note nair -&gt; Dtilt is very inconsistent against short character\xE2\x80\x99s like puff).</p>\x0A</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1577725917, Field1: makeNimstrLit("sora"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -19708635, Field1: makeNimstrLit("olimar"), Field2: []}, {Field0: -559580122, Field1: makeNimstrLit("yoshi"), Field2: makeNimstrLit("<h2>General gameplan</h2>\x0A<ul>\x0A<li>\x0A<p>Generally what I do is use nair a lot until about 30 percent, then I spam the ever loving fuck outta bomb</p>\x0A</li>\x0A<li>\x0A<p>Be careful of egg toss when edge guarding</p>\x0A</li>\x0A<li>\x0A<p>You can try to bait a high recovery by jumping out early backwards and threatening a back air which if they jump you can return to stage and punish the landing. Back air will go through egg so if they throw it out you can hit through or drop beneath it and punish the end lag. Up air is really good at covering going above ledge as well. If they don\'t jump you can drop down and hit them with the back air.</p>\x0A</li>\x0A<li>\x0A<p>If you don\'t have time to do this though, your best bet is to ledgetrap. Using bacon is tough, because of egg toss. So, I usually wait until they grab ledge, and reflect/shield any eggs, then ledge trap normally.</p>\x0A</li>\x0A</ul>\x0A<h2>Vods</h2>\x0A<ul>\x0A<li><a href=\"https://www.youtube.com/watch?v=TnHpmnaQ_OM\" target=\"_blank\">Check out Miya vs Yoshidora</a></li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 249896745, Field1: makeNimstrLit("bowser"), Field2: makeNimstrLit("<h2>General gameplan</h2>\x0A<ul>\x0A<li>\x0A<p>In neutral, Bowser will try to fight you in neutral with patience, good positioning and using up B oos as a zone bursting option. He will spend his time in neutral playing grounded bc he has access to quick grounded buttons like jab and ftilt.</p>\x0A</li>\x0A<li>\x0A<p>He has very little ways to directly contest sh ff nair besides these options.</p>\x0A</li>\x0A<li>\x0A<p>Bowser up B oos is a good zone disrupting tool and can be annoying if we mispace an aerial on his shield. But, he is open for a huge punish afterwards. At low percents we can get dash grab, nair or usmash as a combo starter and at higher percents we can get usmash/dsmash oos.</p>\x0A</li>\x0A<li>\x0A<p>Bowser\xE2\x80\x99s disadvantage is horrible. Harass him as hard as you can with up air and try to push him to the corner for a ledgetrap/edgeguard.</p>\x0A</li>\x0A<li>\x0A<p>Be weary of Bowser dair if you are at high percents, but this option loses to our up air.</p>\x0A</li>\x0A<li>\x0A<p>Ledgetrap Bowser <em>outside</em> of roll distance. His getup attack is huge, and can catch poorly spaced chef setups.</p>\x0A</li>\x0A<li>\x0A<p>You can bait him to getup attack by purposefully doing mispaced chef into dtilt oos. But, look out for dropdown side B.</p>\x0A</li>\x0A<li>\x0A<p>Most bowsers will be looking for ledgejump nair into bair kill confirm as their escape option. Catch their jumps with nair or up air and keep the pressure going.</p>\x0A</li>\x0A<li>\x0A<p>When bowser is offstage, he has decent mixups if he has his double jump. Use up B as an edgeguarding option to push him offstage if you have to.</p>\x0A</li>\x0A</ul>\x0A<h2>Disadvantage</h2>\x0A<ul>\x0A<li>\x0A<p>Disadvantage vs Bowser is tough, because of his ground speed. Retreat to the corner and avoid landing on spots where he can catch your landing with utilt or usmash.</p>\x0A</li>\x0A<li>\x0A<p>He can use flame breath to catch your landings, but this works if he knows you like to land aggressively!</p>\x0A</li>\x0A<li>\x0A<p>Getting off ledge vs Bowser is tough because he can react to every option besides jump with up B oos. Getting off the ledge with jump is your best option, then you slowly mix in other escape options.</p>\x0A</li>\x0A<li>\x0A<p>When recovering, please do not overshoot up B as a recovery. He will punish you on the way down with usmash, utilt or up air.</p>\x0A</li>\x0A<li>\x0A<p>When you are at KO percents, look out for Bowser side B. He will catch you with this when he knows you are scared and become shield heavy.</p>\x0A</li>\x0A</ul>\x0A<h2>Bread and Butter kill confirm percents</h2>\x0A<ul>\x0A<li>\x0A<p>Nair -&gt; Dtilt kills at 114% at ledge</p>\x0A</li>\x0A<li>\x0A<p>Nair -&gt; Ftilt kills at 124% at ledge</p>\x0A</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 861289779, Field1: makeNimstrLit("corrin"), Field2: []}, {Field0: -1858281164, Field1: makeNimstrLit("donkey_kong"), Field2: []}, {Field0: 446026292, Field1: makeNimstrLit("link"), Field2: makeNimstrLit("<h2>General gameplan</h2>\x0A<ul>\x0A<li>\x0A<p>I prefer to mostly camp in this matchup, forcing Link to approach.</p>\x0A</li>\x0A<li>\x0A<p>In many matchups, Link will want to use landing nair in neutral as an opener. We can simply shield -&gt; up b this move, or even up b when he\xE2\x80\x99s above us (before the move even touches our shield).</p>\x0A</li>\x0A<li>\x0A<p>If Link doesn\'t want to approach, he will throw projectiles. Using bucket to deal with arrow and boomerang can be a bit too committal for little reward, so I usually avoid using bucket, unless it\xE2\x80\x99s to reflect boomerang returning to Link.\x0AInstead, we can use back air to destroy arrows and boomerang.</p>\x0A</li>\x0A<li>\x0A<p>Link\xE2\x80\x99s bomb explosion can be absorbed (fills 1 stack of bucket). Usually Link has to manually blow up the bomb. He will try to bait you to use bucket, so he can punish you during the move\xE2\x80\x99s lag. He will not want to fill your bucket, as it can kill Link pretty early.</p>\x0A</li>\x0A<li>\x0A<p>To deal with this, we can manually explode the bomb with our forward air. There\'s a specific timing that can be used to blow up the bomb AND absorb that explosion with our bucket. See <a href=\"https://youtu.be/G2A4c_A6Wn4?t=34\" target=\"_blank\">this video on how to perform this setup properly</a>.\x0AIt is worth practicing, I\xE2\x80\x99ve won games and sets from doing this against multiple Link mains.</p>\x0A</li>\x0A</ul>\x0A<h2>Ledge trapping and edge guarding</h2>\x0A<ul>\x0A<li>\x0A<p>Link will usually recover in 1 of 2 ways: Up b from under the ledge, or use bomb recovery.</p>\x0A</li>\x0A<li>\x0A<p>When link is recovering low, I like to use chef 3 (neutral chef angle) to get as many hits in as possible. When he gets to ledge, you will be in getup-attack range. We can use this as a bait to jump -&gt; fair the ledge to punish the getup attack. If he catches on, he\xE2\x80\x99ll likely try to roll or jump.</p>\x0A</li>\x0A<li>\x0A<p>If Link is at a high % and recovering low, try to hit his head with dair while he is going for up b.</p>\x0A</li>\x0A<li>\x0A<p>If Link is far from the stage, you can try getting near him for a back air before he has time to pull bomb and use it to recover.</p>\x0A</li>\x0A<li>\x0A<p>If Link is going to bomb recover high, just try to punish his landing and send him back off stage asap.</p>\x0A</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1682730300, Field1: makeNimstrLit("pikachu"), Field2: makeNimstrLit("<h1>Win Conditions</h1>\x0A<ul>\x0A<li>Forcing Pikachu to approach.</li>\x0A<li>Conditioning him to shield and grabbing at low percents.</li>\x0A<li>Using bucket to catch Tjolt and thunder. Removing this move from play makes the MU much easier. Don\'t keep it too long though.</li>\x0A<li>Good ledge trapping does lots of damage and forces the pika to do risky recoveries.</li>\x0A</ul>\x0A<h1>Focus</h1>\x0A<ul>\x0A<li>Recovery habits and mixups. A good read at high percent offstage or even mid percent can kill him.</li>\x0A<li>Disadvantage habits. What do they do in the air while getting juggled?</li>\x0A<li>Look for up-b habits on ledge. Punish with a dash attack if close enough or go for a grab since they will shield most likely.</li>\x0A<li>Look for jumping habits. Pika\'s aerials are their best moves. All can be beaten by nair.</li>\x0A</ul>\x0A<h1>Neutral</h1>\x0A<ul>\x0A<li>Pikachu will up-b into you a lot to approach especially online.</li>\x0A<li>They will wait for you to touch their shield. Bair out of shield is fast. Parrying is a combo starter.</li>\x0A<li>They will try to wall you out with fair and dair. Somewhat hard to punish but if you can time it then nair them. Bair works well against both but is more commital than nair.</li>\x0A<li>When panicking look out for tjolts.</li>\x0A<li>Pikachu can\'t pressure your shield too well because of up-b.</li>\x0A<li>Condition to shield then grab.</li>\x0A<li>Will almost always dash attack out of shield or to punish at high percents. (Frame 6.)</li>\x0A<li>Avoid grabs at low percent. Camp with fair. At lower percents to avoid getting thunder looped.</li>\x0A</ul>\x0A<h1>Disadvantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Watch out for fsmash at ledge. It\'s active forever and covers jump super well. You may be able to roll behind it. Or just wait it out. Once on ledge you can\'t get hit by it.</li>\x0A<li>Will use fair,bair, upair to ledgetrap. Tjolts too but just start bucketing them.</li>\x0A<li>Avoid regrabbing. Pika is fast enough to punish.</li>\x0A<li>Careful when using up-b. Thunder kills really early.</li>\x0A</ul>\x0A<h2>Offstage</h2>\x0A<ul>\x0A<li>Bair will kill at high percent. Active for a long time so be quick to react to it.</li>\x0A<li>Will try to catch your up-b with thunder. If under you just bucket to be safe or up-b quickly.</li>\x0A<li>Can get 2framed by a lot so mix up timings or wait for endlag on certain attacks. (fsmash)</li>\x0A<li>Will use dair to catch up-b as well. Also active forever.</li>\x0A<li>In general: watch out for active hitboxes. Don\'t always up-b towards the stage. Air dodging to the stage helps if he commits to an edgeguard.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Use DI and SDI to get out of combos. Aside from true combos pika has a hard time juggling.</li>\x0A<li>Will usually try to punish landings since she doesn\xE2\x80\x99t have anything fast to cover above her.</li>\x0A<li>Uptilt is a good anti air so watch out for it.</li>\x0A</ul>\x0A<h1>Advantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Chef covers ledge pretty well and covers up-b.</li>\x0A<li>Not too hard to 2frame with dsmash or dash attack.</li>\x0A<li>Hard to keep at ledge because of up b. Force it with bacon then punish.</li>\x0A</ul>\x0A<h2>Offstage</h2>\x0A<ul>\x0A<li>Very difficult to edgeguard. Get a read to kill offstage.</li>\x0A<li>Better off ledgetrapping at lower percents or trying to 2frame.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Small so you have to be more precise with up airs and nairs.</li>\x0A<li>Fast faller too so nairdodge is really good.</li>\x0A<li>Use up-b to follow up if too high.</li>\x0A<li>Upsmash to read nairdodge. Or just wait for the airdodge then nair where he is headed.</li>\x0A</ul>\x0A<h1>Misc.</h1>\x0A<ul>\x0A<li>Can up-b after first hit of dair.</li>\x0A<li>Remember to hold shield because of landing hitboxes.</li>\x0A<li>Up-B is safe-ish on shield.</li>\x0A<li>When in doubt up-b</li>\x0A<li>Up smash is good against her up-b.</li>\x0A<li>Don\'t charge smash attacks in neutral. Spaced fsmash counters it.</li>\x0A</ul>\x0A<h2>Bucket:</h2>\x0A<h3>Tjolt</h3>\x0A<ul>\x0A<li>3 of these kill extremely early.</li>\x0A</ul>\x0A<h3>Thunder</h3>\x0A<ul>\x0A<li>Weaker than tjolt when bucketed. Can\'t bucket the explosion.</li>\x0A</ul>\x0A<h1>Stages</h1>\x0A<h2>Battlefield</h2>\x0A<ul>\x0A<li>Can\'t up-b onto stage properly.</li>\x0A<li>Can cover platforms pretty well.</li>\x0A<li>Nair/Upair extensions.</li>\x0A</ul>\x0A<h2>Final Destination</h2>\x0A<ul>\x0A<li>Decent stage for both players. More in GnW\'s favor imo.</li>\x0A<li>Good for juggling.</li>\x0A<li>Easier to follow movement since Pika\'s movement is limited.</li>\x0A</ul>\x0A<h2>Town and City</h2>\x0A<ul>\x0A<li>Always ban.</li>\x0A<li>Platform extensions and mix-ups are too good for pika.</li>\x0A</ul>\x0A<h2>Kalos</h2>\x0A<ul>\x0A<li>Walls are too powerful for her recovery on this stage.</li>\x0A<li>Platforms cover a lot for Pika\'s ledgetrapping so it\'s harder to up-b above ledge.</li>\x0A<li>Thunder still kills early. She lives way longer than GnW does so the trade off isn\'t worth it.</li>\x0A</ul>\x0A")}, {Field0: -863941827, Field1: makeNimstrLit("min_min"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -74399425, Field1: makeNimstrLit("chrom"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1477441465, Field1: makeNimstrLit("mario"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -932942515, Field1: makeNimstrLit("rob"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1281212751, Field1: makeNimstrLit("falco"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 917018705, Field1: makeNimstrLit("byleth"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -2082695083, Field1: makeNimstrLit("robin"), Field2: makeNimstrLit("<h1>Win Conditions</h1>\x0A<ul>\x0A<li>Keep advantage state with juggling for damage. Bad disadvantage from robin allows for huge punishes.</li>\x0A<li>Primary way to kill Robin is through edgeguarding. Whiff punishing is good too but riskier.</li>\x0A<li>Avoiding arcfire at all costs. Leads to too much percent or early kills.</li>\x0A<li>Playing a defensive neutral right out of burst range to avoid getting hit with projectiles or grabs.</li>\x0A</ul>\x0A<h1>Focus</h1>\x0A<ul>\x0A<li>Disdavantage Options: Look out for airdodges or up air out of hitstun.</li>\x0A<li>Recovery habits: Will Robin go high or low or throw out a hitbox. Keep these in mind to back air or dair successfully.</li>\x0A<li>Mixing up landings: Her punish game is very strong so be aware of your own landing habits.</li>\x0A<li>Avoiding projectiles as that\'s her main form of damage and kill confirms.</li>\x0A</ul>\x0A<h1>Neutral</h1>\x0A<ul>\x0A<li>Overall you want to play a neutral where you don\xE2\x80\x99t approach or hold in.</li>\x0A<li>Jumping over the laggy projectiles and crouching under the fast ones is good. Stay out of burst range though.</li>\x0A<li>Don\'t overcommit to smash attacks or aerials. She has options to beat both with heavy punishes.</li>\x0A<li>Avoid spot dodging and mashing attacks. Try to focus more on avoiding pressure and wasting her levin and books through movement.</li>\x0A<li>You can bair through arcfire or dash attack under it.</li>\x0A<li>Only use bucket if you\'re out of grab range. Go for arcfire (before it explodes), thunder, arcthunder.</li>\x0A</ul>\x0A<h1>Disadvantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Arcfire is almost a guaranteed 2frame at ledge. Try to time it so you grab ledge right after it despawns.</li>\x0A<li>Be aware of what kind of punish robin wants. She will look for aerials, downsmash, dash attack, or a smash attack. Choose based on previous options or just to mix up.</li>\x0A<li>During arcifre startup you can roll and up b for a good punish. Grab is good too if spaced right.</li>\x0A<li>You can go high through arcfire with up b but you won\'t have a jump afterwards and can get punished by levin.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>When above robin look out for aerials for the most part. Up air is the main one.</li>\x0A<li>Don\'t dair out of disadvantage unless it\xE2\x80\x99s a guaranteed punish or you\'re far enough to not get punished.</li>\x0A<li>Be careful of airdodging because you can get frame trapped very easily.</li>\x0A<li>Avoid going to ledge if possible through landing mixups or drifting mixups.</li>\x0A</ul>\x0A<h1>Advantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Chef works super well versus robin.</li>\x0A<li>Be careful of projectiles while robin is recovering to get you off ledge. Bucket works perfectly for this.</li>\x0A<li>Be ready to catch jumps with nair or up air. Robin has a high jump but airspeed isnt too great.</li>\x0A</ul>\x0A<h2>Offstage</h2>\x0A<ul>\x0A<li>Look for recovery habits. Her offstage prescence isn\'t too threatening and you can back air for free and can go deep. Be careful not to be under her before she up b\'s.</li>\x0A<li>Dair is also really good however her up air can beat it and if you miss it she can get a good punish with levin or she\'ll go back to stage for free. Use it after a frame trap.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Robin is combo food. Don\'t overextend with nair or up air or you will eat an up air. Just be careful of reversals.</li>\x0A<li>Try to track her drift. It\'s all she really has in disadvantage along with airdodge.</li>\x0A<li>Fast fall airdodge is a good option and easy to punish so look out for this one.</li>\x0A</ul>\x0A<h1>Misc</h1>\x0A<ul>\x0A<li>Average airspeed</li>\x0A<li>Very big disjoints</li>\x0A<li>Arcfire is pretty slow and laggy</li>\x0A<li>Do NOT bucket exploded arcfire.</li>\x0A<li>Up Air can beat my dair.</li>\x0A</ul>\x0A<h1>Stages</h1>\x0A<h2>Battlefield</h2>\x0A<ul>\x0A<li>Great combos, big blastzones.</li>\x0A</ul>\x0A<h2>Small Battlefield</h2>\x0A<ul>\x0A<li>Decent combos, small ceiling so you die eariler to up smash or uair.</li>\x0A</ul>\x0A<h2>Final Destination</h2>\x0A<ul>\x0A<li>Decent combos, big blastzones, Robin has even worse disadvantage here.</li>\x0A</ul>\x0A<h2>Town and City</h2>\x0A<ul>\x0A<li>You will get cheesed</li>\x0A</ul>\x0A<h2>Smashville</h2>\x0A<ul>\x0A<li>Holding center stage is very strong. Easy juggles and combo extensions. Small though so be careful about projectiles.</li>\x0A</ul>\x0A<h2>Pokemon Stadium 2</h2>\x0A<ul>\x0A<li>Neutral stage overall though you will most likely get camped harder since its so big. Big blast zones though.</li>\x0A</ul>\x0A<h2>Yoshi\'s Story</h2>\x0A<ul>\x0A<li>You will get cheesed</li>\x0A</ul>\x0A<h2>Lylat</h2>\x0A<ul>\x0A<li>You will get cheesed</li>\x0A</ul>\x0A<h2>Kalos</h2>\x0A<ul>\x0A<li>Overall it is okay but you lose kill power and give robin more recovery options. You will also get camped more.</li>\x0A</ul>\x0A")}, {Field0: -604960682, Field1: makeNimstrLit("daisy"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -866004386, Field1: makeNimstrLit("king_dedede"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1411473506, Field1: makeNimstrLit("ridley"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -502051226, Field1: makeNimstrLit("piranha_plant"), Field2: []}, {Field0: -2069494425, Field1: makeNimstrLit("richter"), Field2: []}, {Field0: -2104244633, Field1: makeNimstrLit("sheik"), Field2: []}, {Field0: -1621867415, Field1: makeNimstrLit("fox"), Field2: makeNimstrLit("<h1>Win Conditions</h1>\x0A<ul>\x0A<li>Keeping a % lead or a stock lead forces him to approach. Most approaches are snuffed out by Up-B. Fox can grab as a mix-up though but not dangerous.</li>\x0A<li>Successful edgeguards/ledge trapping rack up a ton of damage or just kill him.</li>\x0A<li>Stay out of up air range. One of his most dangerous combos is up air strings.</li>\x0A<li>Play near ledge so his combos become much more limited and so you can retreat to the ledge.</li>\x0A<li>Keep your disadvantage in check. Fox will abuse any mistakes and will kill you or do a ton of damage. (Careful with airdodges and mashing)</li>\x0A</ul>\x0A<h1>Focus</h1>\x0A<ul>\x0A<li>Nair patterns and what he does afterwards. Super safe and leads into multiple combos. UpB helps a ton but a well-timed nair is safer and can lead to jab. Can bait out upB and punish with up air.</li>\x0A<li>Escape options in disadvantage for myself. Don\'t air dodge or dair except maybe as a mix-up. Going to the ledges is safer unless ledge trapping is on point or landing and shielding.</li>\x0A<li>Shielding habits. Grabs at low percents get him to kill percent. He has access to Up smash OoS so be wary. Nair too.</li>\x0A<li>Keep fox in disadvantage. Neutral is rough if you have to approach.</li>\x0A</ul>\x0A<h1>Neutral</h1>\x0A<ul>\x0A<li>You want to get him to jump into your shield. UpB covers most options and he can\'t get a good punish on a shield unless he up airs you when you UpB.</li>\x0A<li>Shielding is one of the safer options in neutral. He can go for grabs but you can spot dodge to punish though it can be baited out. If in doubt just stay in shield unless it runs low.</li>\x0A<li>Delay attack after up B because of f2 air dodge.</li>\x0A<li>Don\'t mash to keep him out his frame data is really good and he can punish just about anything.</li>\x0A<li>Try to corner him and keep him at ledge to limit his options and combos.</li>\x0A</ul>\x0A<h1>Disadvantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Careful of fsmash. Active and can catch jump, getup, and roll. Can hit ledge too with weak spot. Lots of lag though.</li>\x0A<li>Run up dsmash is somewhat good but nair can deal with it. Just be careful of baits.</li>\x0A<li>Only nair if he throws out a laggy move at ledge. He\xE2\x80\x99s too fast to catch off guard.</li>\x0A<li>Careful about regrabs since his down smash can kill.</li>\x0A<li>Hanging at ledge is pretty good vs Fox since he doesn\'t have many options to deal with it. (If you have a lead. )</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Use dair carefully. Fox can easily punish it. You can use it when he whiffs an up air or you can straight up challenge it but it has to be spaced right.</li>\x0A<li>Try to go for the ledge he doesn\xE2\x80\x99t have many things to deal with ledgegrabs.</li>\x0A<li>Avoid air dodging most of the time. If you have to try to drift to the ledge to avoid fox vortex or air dodge offstage if close enough.</li>\x0A</ul>\x0A<h1>Advantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Chef is really good and can combo into ftilt or a smash attack.</li>\x0A<li>Down smash 2frames fox pretty easily.</li>\x0A<li>Dair if you can time it right the spike kills extremely early.</li>\x0A<li>Dash attack is also super good at 2framing.</li>\x0A</ul>\x0A<h2>Offstage</h2>\x0A<ul>\x0A<li>Fox can recover super high. Hard to contest except with up b or up airs. Take his jump with up air or nair and keep pressuring him.</li>\x0A<li>Firefox has a lot of startup. Just go for back air if he\'s force to use it.</li>\x0A<li>If you can\'t get offstage fast enough go for dash attack 2frames or ftilt/dsmash to catch side b or even up b.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>You can do some pretty good damage with nair and up air. Try to opt for nair more as its easier to land.</li>\x0A<li>Fox has bad airspeed so you can force him to airdodge pretty easily.</li>\x0A<li>Frame 2 air dodge makes combos harder and he can land and uptilt or another fast option so be aware of that.</li>\x0A</ul>\x0A<h1>Misc.</h1>\x0A<ul>\x0A<li>Playing at ledge is very good but you give up stage control for it but also limit fox\'s options.</li>\x0A</ul>\x0A<h1>Stages</h1>\x0A<h2>Battlefield</h2>\x0A<ul>\x0A<li>Neutral stage overall both characters get a lot from it.</li>\x0A</ul>\x0A<h2>Final Destination</h2>\x0A<ul>\x0A<li>Always ban.</li>\x0A</ul>\x0A<h2>Town and City</h2>\x0A<ul>\x0A<li>Always Ban</li>\x0A</ul>\x0A<h2>Smashville</h2>\x0A<ul>\x0A<li>Decent stage, try to keep stage control under the platform as much as possible.</li>\x0A</ul>\x0A<h2>Pokemon Stadium 2</h2>\x0A<ul>\x0A<li>Neutral stage though you\'re susceptible to getting platform camped.</li>\x0A</ul>\x0A<h2>Yoshi\'s Story</h2>\x0A<ul>\x0A<li>More advantages for game and watch though you die extremely early to upair but his disadvantage is awful on this stage. Easy 2frames and early kills.</li>\x0A</ul>\x0A<h2>Lylat</h2>\x0A<ul>\x0A<li>Always ban. Fox probably won\'t go here but it\xE2\x80\x99s a risky stage for both characters. Better to avoid it.</li>\x0A</ul>\x0A<h2>Kalos</h2>\x0A<ul>\x0A<li>Always ban. Lives way longer but he has more raw kill power so it benefits fox more. Very easy to get juggled and he has more recovery options.</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1557688173, Field1: makeNimstrLit("ryu"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -897124241, Field1: makeNimstrLit("inkling"), Field2: []}, {Field0: -1189835409, Field1: makeNimstrLit("wolf"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 669781364, Field1: makeNimstrLit("greninja"), Field2: []}, {Field0: 2062329461, Field1: makeNimstrLit("king_k_rool"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1862255228, Field1: makeNimstrLit("pac_man"), Field2: []}, {Field0: -1488042875, Field1: makeNimstrLit("little_mac"), Field2: makeNimstrLit("<h2>Win Conditions</h2>\x0A<ul>\x0A<li>Keeping a stock advantage.</li>\x0A<li>Sending him offstage can almost always lead to a kill if punished correctly. Hard to cover multiple options so you usually have to read or bait an option out.\x0A-Avoiding interaction when at an advantage.</li>\x0A</ul>\x0A<h2>Focus:</h2>\x0A<ul>\x0A<li>Capitalizing on edge guards. Looking out for mix-ups on recovery. (Side B is very hard to challenge)</li>\x0A<li>Using up Mac\'s resources offstage. (One jump, side b, air dodge)</li>\x0A<li>Trades on ledge can kill him.</li>\x0A<li>Avoiding interactions in neutral due to his speed, kill power, and overall neutral.</li>\x0A<li>His up-b doesn\xE2\x80\x99t always snap to ledge unless spaced well. Easy to hit with dsmash, dash attack.</li>\x0A</ul>\x0A<h2>Neutral:</h2>\x0A<ul>\x0A<li>Try to stay on platforms when you have an advantage. Fish for mistakes or risky options from him to punish and rack up more damage or a kill. He has no real answer to platform camping. He has to pressure you with upsmash or commit to an aerial or side b or even up b sometimes.</li>\x0A<li>Avoid air dodging out of dtilt and uptilt. Up b is almost unpunishable, but he can kill  you with up b so look out at high percents. Up B will be your go to option most of the time. If necessary air dodge to the platforms though he can punish it if he waits.</li>\x0A<li>Dash attack is really good to get him offstage but risky. Can follow-up with another DA at low percents to catch first landing. Most macs won\'t jump so this can work.</li>\x0A<li>Avoid rolling since it\'s too slow. Rely on up-b to get out of most situations EXCEPT dtilt KO punch, you need the iframes at f3 to avoid. Air dodge is very laggy so he can punish it if he reacts or waits.</li>\x0A<li>When platform camping, drop down fair is really good pressure and pretty safe. Just watch out for smash attacks or antiairs.</li>\x0A<li>Wait 4 seconds for KO punch &quot;armor&quot; to go away, then hit him with anything that will put him in tumble. This will get rid of it.</li>\x0A<li>Don\'t let him pressure your shield. He can break it. Up-B to get out of pressure. He can\'t break your full shield except with full charge downsmash probably. If you start getting shield pressured try to escape to avoid shield break.</li>\x0A</ul>\x0A<h2>Disadvantage:</h2>\x0A<h3>Ledge</h3>\x0A<ul>\x0A<li>Watch out for dsmash and dtilt at ledge. He can 2frame you easily. Mix up recovery timings with bucket or jumping.</li>\x0A<li>Ftilt at ledge will kill early and is active. Mix up your recovery options from ledge. Dtilt is frame 3 which is unreactable so don\'t wait too long or he\'ll kill you off a dtilt.</li>\x0A<li>Can armor through get up attack. Upsmash hits ledge. Try to get off ledge ASAP since his kill power makes it unsafe.</li>\x0A<li>The character overall is very dangerous at ledge and has the speed to cover almost everything though he does have to commit to punish so actively mixing it up is always good.</li>\x0A</ul>\x0A<h3>Juggling</h3>\x0A<ul>\x0A<li>Mac can\'t juggle luhmao.</li>\x0A<li>If in the air though he will try to catch landings. He usually tries to take your jump but it\'s not too much of a problem with up b.</li>\x0A<li>Don\'t Dair, it is super punishable by him. Either land on a platform or throw out a hitbox safely to protect yourself like fair or bair, just be aware of his armored smash attacks.</li>\x0A</ul>\x0A<h2>Advantage:</h2>\x0A<h3>Ledge</h3>\x0A<ul>\x0A<li>Dash attack sends at a good angle. May lead into bair. Side B might outrange your dash attack.</li>\x0A<li>Dsmash can 2 frame, but sweetspot will send up. Sour spot will kill him.</li>\x0A<li>Punish get up attack on shield with dtilt. Will most likely kill him at mid% and up. Upsmash at 0 to mid % for damage.</li>\x0A<li>Down smash at ledge is good.</li>\x0A<li>Chef covers ledgehang, roll (spaced), jump, regular getup. He can side b through it though if given the chance since it\xE2\x80\x99s disjointed it will always beat the bacon. It forces an early option on ledge though.</li>\x0A</ul>\x0A<h3>Offstage</h3>\x0A<ul>\x0A<li>Bair is usually the way to go. Will beat anything he can throw out if spaced well. Side B is the hardest thing to challenge. Watch out for counters too.</li>\x0A<li>All he has are mixups. Bair or force an option then punish. (Counter, Side B, Airdodge, Up-B, Jump)</li>\x0A<li>Watch out for walljump recoveries on some stages. Dair can cover it pretty well if timed right, but will send up. Reverse dair to bounce him off stage.</li>\x0A<li>Dragdown nair and bair will kill him. Just be ready to tech if he side b\'s early.</li>\x0A<li>When you\'re low and he\'s about to don\'t hit him with up-b as a mixup. There\'s a chance he\'ll try teching and airdodge and die instead.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Nair, Upair.</li>\x0A<li>If he starts using Neutral B armor to get down you can catch landings with dash attack. Try to catch landings with grabs. Throw offstage if near ledge or dthrow at low percents for more nair chains.</li>\x0A<li>If he\'s over you just up-b to get him away from you if you\'re not sure what he\'s up to. Up air is okay too if hes above you or just nair.</li>\x0A</ul>\x0A<h2>Misc.</h2>\x0A<ul>\x0A<li>Dtilt KO punch is true unless you airdodge. Try to AD towards a platform or offstage.</li>\x0A<li>Tech everything and mix it up. Jablocks are really good for him and tech chases can kill you or rack up lots of damage. Fair, bair are used for jab lock setups sometimes.</li>\x0A<li>Can\'t shield KO Punch. Has a lot of lag on whiff.</li>\x0A<li>Very fast character and can outspeed your aerial movement.</li>\x0A</ul>\x0A<h2>Stages</h2>\x0A<h3>Battlefield:</h3>\x0A<ul>\x0A<li>Can camp him out hard.</li>\x0A<li>Watch out for wavelandings.</li>\x0A<li>His Up-B will kill at higher percents on the top platform.</li>\x0A</ul>\x0A<h3>Final Destination</h3>\x0A<ul>\x0A<li>Always ban.</li>\x0A</ul>\x0A<h3>Town and City</h3>\x0A<ul>\x0A<li>It\'s an okay stage, but when the platforms disappear, Mac thrives. Stall for platforms. They can save mac too when returning sometimes.</li>\x0A<li>Small blastzones at ledge benefit him more.</li>\x0A</ul>\x0A<h3>Smashville</h3>\x0A<ul>\x0A<li>Really good platform to avoid interaction.</li>\x0A<li>He can\'t reach the platform with upsmash and has to jump which is good for us.</li>\x0A</ul>\x0A<h3>Pokemon Stadium 2</h3>\x0A<ul>\x0A<li>Generally okay. Upsmash reaches the platforms but only if you are directly above him.</li>\x0A<li>Access to walljumps.</li>\x0A<li>Overall a decent stage.</li>\x0A</ul>\x0A<h3>Yoshi\'s Story</h3>\x0A<ul>\x0A<li>Avoid this stage if possible. Triplats are good but small blastzones will get you killed earlier. Uptilt UpB kills very early. And gives him access to walljump.</li>\x0A<li>Easier for him to dsmash/dtilt you when recovering.</li>\x0A</ul>\x0A<h3>Kalos</h3>\x0A<ul>\x0A<li>His worst stage for killing. Has walljump. Use platforms to cover options when edgeguarding.</li>\x0A<li>You live a lot longer on this stage.</li>\x0A</ul>\x0A<h3>Lylat</h3>\x0A<ul>\x0A<li>Not enough info.</li>\x0A</ul>\x0A")}, {Field0: 1678674054, Field1: makeNimstrLit("ganondorf"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1766580597, Field1: makeNimstrLit("diddy_kong"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 651466383, Field1: makeNimstrLit("joker"), Field2: []}, {Field0: 1695946383, Field1: makeNimstrLit("toon_link"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 694791314, Field1: makeNimstrLit("duck_hunt"), Field2: []}, {Field0: 1666503315, Field1: makeNimstrLit("mii_brawler"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1315739029, Field1: makeNimstrLit("mythra"), Field2: makeNimstrLit("<h2>General gameplan and tips</h2>\x0A<p>Pythra\xE2\x80\x99s disjoints beat G&amp;W pretty hard, but Aegis has a pretty bad disadvantage state, particularly landing and recovering.\x0AIf you can gimp Aegis, you win.</p>\x0A<p>In neutral camp Pyra out. If she gets to hit you you lose.</p>\x0A<p>Focus on their habits when they recover, it\xE2\x80\x99s a bit linear but they can mix it up with swap.\x0ALuckily, bair is long lasting enough to last through swap.</p>\x0A<p>If you put them in a situation where they have to Photon Edge to recover, you can use up b to send them further off stage.\x0ASee <a href=\"https://youtu.be/MWSPUz2iMSI?t=1277\" target=\"_blank\">this video timestamp</a> of Miya using up b against Mythra\'s side b.</p>\x0A<p>They are a bait and punish character (especially Mythra, Pyra is more of a Waller) too but Mythra significantly outspeeds G&amp;W so you can\xE2\x80\x99t really camp her out. Remember the neutral triangle (Bait and punish beats poking, overshooting beats B&amp;P, poking beats overshooting). Keep Aegis in disadvantage for as long as possible, juggling and ledgetrapping them to hell. Pyra F Tilt is safe on G&amp;W shield if spaced properly so don\xE2\x80\x99t contest that. If Pyra is above you on a platform, beware of her dair.</p>\x0A<p>When landing, stay the hell away from them.</p>\x0A<p>The key in neutral is seriously just better bait and punish, overshooting and poking. Don\xE2\x80\x99t grab movement, only grab whiffs (that\xE2\x80\x99s universal but it\xE2\x80\x99s especially true with Mythra. However, it\xE2\x80\x99s a bit weird. Foresight activation frames lasts from frames 2-7, but grabs don\xE2\x80\x99t activate Foresight, so she can be grabbed until Frame 8).</p>\x0A")}, {Field0: -457491563, Field1: makeNimstrLit("steve"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1239869336, Field1: makeNimstrLit("dr_mario"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 796016796, Field1: makeNimstrLit("zero_suit_samus"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1191960990, Field1: makeNimstrLit("samus"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 328022176, Field1: makeNimstrLit("terry"), Field2: makeNimstrLit("<h2>General gameplan</h2>\x0A<ul>\x0A<li>\x0A<p>While getting hit by powerdunk, SDI\xE2\x80\x99ing down+in really hard will make you fall out of the move, pretty much 100% of the time</p>\x0A</li>\x0A<li>\x0A<p>Power Gyser is -29 on shield. Either up smash, or dsmash this move</p>\x0A</li>\x0A<li>\x0A<p>Buster wolf is -45 on shield. You can charge an up smash for quite a long time here for a huge punish</p>\x0A</li>\x0A<li>\x0A<p>His neutral b can be absorbed with bucket, and his approach options aren\xE2\x80\x99t great. Force him to approach, and call out his movement.\x0ABucket will kill at 15% at center stage on FD.</p>\x0A</li>\x0A<li>\x0A<p>Once Terry gets go meter, you should be careful when attacking his shield with anything but nair or fair as he can do jab into buster wolf if you do a laggy move on his shield which can kill at around 60-70%.</p>\x0A</li>\x0A<li>\x0A<p>Terry can do Jab Jab Input Up B and it will kill G&amp;W at around 100%\x0AThis can be avoided by sdi away, however you have to guess if Terry is doing Input up b or input down b, so when you go over 100% it\xE2\x80\x99s easier to just try to avoid any committal moves on his shield.</p>\x0A</li>\x0A<li>\x0A<p>Crack Shoot has 12 frames of endlag on shield, which means a perfectly timed down smash can punish crack shoot OOS. You can also punish with up b.\x0ASome Terry players love to do Crack Shoot in the middle of neutral. This can be intercepted mid Crack Shoot by Up smash or F smash, however you have to read it and time it correctly.</p>\x0A</li>\x0A</ul>\x0A<h2>Edge guarding</h2>\x0A<ul>\x0A<li>\x0A<p>Terry players seem to love recovering high, with either burning knuckle or powerdunk.\x0AThis predictable recovery makes them very susceptible to our Bair or Up b</p>\x0A</li>\x0A<li>\x0A<p>If terry recovers low, we can easily stage-spike with bair since their mixups off stage are very limited</p>\x0A</li>\x0A</ul>\x0A<h2>Bread and Butter kill confirm percents</h2>\x0A<ul>\x0A<li>Nair -&gt; Dtilt will kill terry at around 104% at ledge</li>\x0A<li>Nair -&gt; Ftilt kills at around 115% at ledge</li>\x0A</ul>\x0A")}, {Field0: -705950303, Field1: makeNimstrLit("squirtle"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1667035738, Field1: makeNimstrLit("lucina"), Field2: []}, {Field0: 892418726, Field1: makeNimstrLit("simon"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1792460374, Field1: makeNimstrLit("charizard"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1305414573, Field1: makeNimstrLit("captain_falcon"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1345990737, Field1: makeNimstrLit("lucario"), Field2: []}, {Field0: -1892594768, Field1: makeNimstrLit("peach"), Field2: []}, {Field0: 522203569, Field1: makeNimstrLit("incineroar"), Field2: makeNimstrLit("<h2>General gameplan and tips</h2>\x0A<ul>\x0A<li>\x0A<p>Play very grounded! Try to bait and punish. Only try bursting in with nair if bait and punish isn\'t working out</p>\x0A</li>\x0A<li>\x0A<p>Throwing him off stage is better than going for a juggle, according to Maister. Get those bacons in, or punish side b/up b if his mixups are more limited</p>\x0A</li>\x0A<li>\x0A<p>If he falls out of landing bair, just shield. He can spot dodge neutral b for an early kill if we try to grab, like we usually do vs most other characters.</p>\x0A</li>\x0A<li>\x0A<p>Never use fair in this matchup, UNLESS you\'re going for unblockable grab on shield. If he is countering the bombs, we can shield the counter attack then grab.</p>\x0A</li>\x0A<li>\x0A<p>Shield neutral b when he\'s at kill % and we have a healthy shield, shield 3 hits THEN spot dodge. We have a lot of time to punish this move.</p>\x0A</li>\x0A<li>\x0A<p>Incins land on stage with counter attack a lot. We can bait it out and get a huge punish, grab combo, etc.</p>\x0A</li>\x0A<li>\x0A<p>If he is counter attacking bacon, just keep hitting him with bacon until can get an opening to grab or ftilt</p>\x0A</li>\x0A</ul>\x0A<h2>Punishing his landings</h2>\x0A<ul>\x0A<li>\x0A<p>Shield incin when he\'s landing after being juggled. Can punish any of his aerials with grab or up b, if he counters we can wait and react, if he does side b we have enough time to react and up b through it.</p>\x0A</li>\x0A<li>\x0A<p>ALWAYS grab landing nair or fair on shield, it\'s just laggy enough to grab</p>\x0A</li>\x0A<li>\x0A<p>Spaced bair can\'t be grabbed, just up b it</p>\x0A</li>\x0A<li>\x0A<p>Incins like to neutral b after whiffing attacks, be careful of this and punish</p>\x0A</li>\x0A<li>\x0A<p>Look for openings for grabs a lot</p>\x0A</li>\x0A<li>\x0A<p>His nair/fair will go through 3-4 bacons, don\'t throw bacon when he\'s up high/recovering high</p>\x0A</li>\x0A<li>\x0A<p>Incin mains love jumping from ledge, so use nair or up air after throwing bacon if he snaps to ledge without bacon hitting him</p>\x0A</li>\x0A</ul>\x0A<h2>Surviving</h2>\x0A<ul>\x0A<li>DI up if incin rising up b connects, we will always fall out</li>\x0A<li>Air dodge toward the stage if incin side b connects so you\'ll live longer</li>\x0A</ul>\x0A<h2>Punishing his recovery</h2>\x0A<ul>\x0A<li>Ftilt incin recovery at ledge</li>\x0A<li>Always shield his aggressive up b\'s back onto stage</li>\x0A<li>We can up b through his up b to kill him off stage!</li>\x0A<li>If he\'s recovering low close to the stage, we can dair his up b recovery</li>\x0A</ul>\x0A<h2>Getting off ledge</h2>\x0A<ul>\x0A<li>If he is trying to dtilt at ledge, jumping over him from ledge is free</li>\x0A</ul>\x0A<h2>Bread and Butter kill confirm percents</h2>\x0A<ul>\x0A<li>At ledge Nair -&gt; Dtilt kills at 112%</li>\x0A<li>At ledge Nair -&gt; Ftilt kills at 120%</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -2100416332, Field1: makeNimstrLit("hero"), Field2: []}, {Field0: 790940084, Field1: makeNimstrLit("marth"), Field2: []}, {Field0: -925261132, Field1: makeNimstrLit("ness"), Field2: []}, {Field0: -891032651, Field1: makeNimstrLit("villager"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -125561413, Field1: makeNimstrLit("sonic"), Field2: []}, {Field0: -955817284, Field1: makeNimstrLit("mega_man"), Field2: []}, {Field0: 861964989, Field1: makeNimstrLit("kirby"), Field2: []}, {Field0: 970982078, Field1: makeNimstrLit("banjo_and_kazooie"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 2050092224, Field1: makeNimstrLit("meta_knight"), Field2: makeNimstrLit("<h2>General gameplan</h2>\x0A<ul>\x0A<li>\x0A<p>In neutral you should be looking out for dash attack and dash grab. They are his main combo starters. He\'ll be looking for those from 0-30% since it\'s the main window for getting his ladder combo early on. He can also get them from up airs on the plat as well but it depends on where he is positioned and how many jumps he has burned.</p>\x0A</li>\x0A<li>\x0A<p>Same idea applies when you are at 70-90% except he is looking for dash attack into up B.</p>\x0A</li>\x0A<li>\x0A<p>You should try to play outside of his dash attack/dash grab burst range and not overextend in neutral.</p>\x0A</li>\x0A<li>\x0A<p>If he is multijumping, he\xE2\x80\x99s generally looking for a landing nair combo starter. Up air/nair him depending on how close he is to you.</p>\x0A</li>\x0A<li>\x0A<p>If MK gets a ladder to the side, you\xE2\x80\x99re pretty much fucked.</p>\x0A</li>\x0A<li>\x0A<p>Dtilt is a strong poke that can lead into a tech chase dsmash or fsmash at mid-late percents. DI up to avoid being put in a tech chase situation.</p>\x0A</li>\x0A<li>\x0A<p>Sometimes its okay to chuck out dsmash/usmash in neutral as a hard callout against his dash attack/grab.</p>\x0A</li>\x0A<li>\x0A<p>Same idea applies if he is multi jumping above you.</p>\x0A</li>\x0A<li>\x0A<p>Getting laddered sucks but you want to mix up your SDI and DI as hard as you can. You can start SDIng around the third up air since it becomes stale and easier to get out of. You can also mash up B too to get out and kill him off the top if he is next to you or escape in a position to where he can\'t Up B himself to kill you.</p>\x0A</li>\x0A<li>\x0A<p>Your main goal when it comes to escaping ladders is to not escape the ladder but to avoid the finisher. The up airs themselves don\xE2\x80\x99t deal much percent but the finisher (depending on MK is positioned) have enough knockback to kill.</p>\x0A</li>\x0A<li>\x0A<p>Outside of ladders, MK has formidable edgeguarding and ledgetrapping. MK will try to wall you with bair/fair if he is ledgetrapping.</p>\x0A</li>\x0A<li>\x0A<p>His edgeguarding is really strong offstage but he will try to cut off low recoveries with nair or neutral B.</p>\x0A</li>\x0A<li>\x0A<p>Don\xE2\x80\x99t recover high otherwise he will up B snipe you. But, don\xE2\x80\x99t be afraid to recover high. You can up B away early on to avoid getting punished and mix your recovery downwards.</p>\x0A</li>\x0A<li>\x0A<p>Watch out for Fsmash at high percentages. It acts like our usmash and he\xE2\x80\x99ll use it as a hard callout if we overextend.</p>\x0A</li>\x0A<li>\x0A<p>MK is really hard to edgeguard since he has multiple jumps and 4 different specials that all act as recovery options but up air cuts off high recoveries and forces him to recover low.</p>\x0A</li>\x0A<li>\x0A<p>Always ban FD</p>\x0A</li>\x0A<li>\x0A<p>Try to take him to Town or Kalos. The higher ceilings work against his ladder combos and we have more space to move around in.</p>\x0A</li>\x0A<li>\x0A<p>Time out MK if you have to. Although he has multi jumps and many mobile special moves, we move faster in the air.</p>\x0A</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 710861252, Field1: makeNimstrLit("roy"), Field2: makeNimstrLit("<p>Roy\xE2\x80\x99s fsmash on shield can be down tilted if we are close to him during the initial hit.</p>\x0A<p>If the end of the hit (far) touches our shield, it has significantly more lag.\x0AWe can run up -&gt; dtilt for an early kill.</p>\x0A<p>Dtilt will kill Roy at about 120% center stage when we have 50% rage (tested on PS2)</p>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -277309240, Field1: makeNimstrLit("wario"), Field2: []}, {Field0: -37127991, Field1: makeNimstrLit("mii_swordfighter"), Field2: []}, {Field0: -1680693046, Field1: makeNimstrLit("mewtwo"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -331876660, Field1: makeNimstrLit("mii_gunner"), Field2: []}, {Field0: -1170298931, Field1: makeNimstrLit("pit"), Field2: []}, {Field0: -729405235, Field1: makeNimstrLit("snake"), Field2: []}, {Field0: 1213895119, Field1: makeNimstrLit("bayonetta"), Field2: makeNimstrLit("<h1>Win Conditions</h1>\x0A<ul>\x0A<li>Being able to keep a stock or percent lead helps out a ton. She has a hard time approaching and you can play more defensively.</li>\x0A<li>Holding control of center stage helps tremendously since her kill power is reduced and she has to commit if you\'re shielding.</li>\x0A<li>Capitalizing off of any combo starter but not overcommitting. She has a frame 1 air dodge and a counter so be careful of combos that aren\'t true.</li>\x0A</ul>\x0A<h1>Focus</h1>\x0A<ul>\x0A<li>Side B habits and mixups. If you have a good grasp on how she will approach you can punish most attacks.</li>\x0A<li>Interactions with shield. She has no good kill throws aside from fthrow at high percents (and usually works on ledge only)</li>\x0A<li>Approaches in general. A good read on them will let you rack up damage easily as well as kill. You can upsmash grounded side b OoS to kill.</li>\x0A</ul>\x0A<h1>Neutral</h1>\x0A<ul>\x0A<li>Shield a lot. When she rushes in its usually a grab. Spot dodge and smash attack or upb.</li>\x0A<li>Side B on shield can be upsmashed or upb\'d. Grab at low percents.</li>\x0A<li>Dash attack crosses up. UpB works if close enough or just bair OoS if too far.</li>\x0A<li>Try to bait out smash attacks or side b.</li>\x0A</ul>\x0A<h1>Disadvantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Will probably go for smash attacks. Maybe bair to bait out rolls or jumps. Best to recover really high if possible.</li>\x0A<li>Can\'t wait too long or I\'ll get down smashed or down tilted.</li>\x0A<li>Roll is the most punishable so don\'t roll too much.</li>\x0A<li>Well timed regular getups should lead to punishes when shielding afterwards. Careful of grabs though.</li>\x0A<li>Dash attack crosses up on shield which is usually followed up by a side b towards the stage as a mixup.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Don\'t dair when shes on the ground or if at high percents. Go offstage or mix up landings.</li>\x0A<li>Directional air dodging is really bad.</li>\x0A<li>SDI down or down/away lets you get out of her combos pretty easily. Followups are limited though dair will kill at high percents.</li>\x0A<li>SDI up may let you up B but you can die if she follows it.</li>\x0A<li>SDI aerial side b away? Needs more testing.</li>\x0A</ul>\x0A<h1>Advantage</h1>\x0A<h2>Ledge</h2>\x0A<ul>\x0A<li>Try to call out side b from ledge. Don\'t stand at ledge too much. Upsmash and nair are good attacks to punish a whiffed side b.</li>\x0A<li>Chef works pretty well on ledge. Don\'t overuse or she will witch time it.</li>\x0A<li>She doesn\'t always snap to ledge so dsmash and ftilt can hit her easily with good timing. She can punish a whiff with side b though.</li>\x0A<li>Look out for wall clings she can change her timings up. A dair can deter this.</li>\x0A</ul>\x0A<h2>Offstage</h2>\x0A<ul>\x0A<li>When offstage you can bair her pretty easily but it has to be spaced correctly so it won\'t trade with side b.</li>\x0A<li>Dair is very useful. Beats out almost anything unless you misspace it when she up b\'s.</li>\x0A<li>She has a very good recovery in terms of distance so she can go pretty low or high too.</li>\x0A</ul>\x0A<h2>Juggling</h2>\x0A<ul>\x0A<li>Usually cant get more than a nair&gt;upair or nair&gt;nair or uair&gt;uair. Don\'t overcommit to a juggle since she has a good air dodge.</li>\x0A<li>Mix up your juggling with empty hops. Chances are she\'ll throw out a witch time or an airdodge which can lead to a heavier punish.</li>\x0A</ul>\x0A<h1>Misc.</h1>\x0A<ul>\x0A<li>Upsmash OoS her side B</li>\x0A<li>Fsmash or Dsmash her smash attacks on shield. Especially when using guns after a smash attack. It can reach when you\'re out of stun range.</li>\x0A<li>Nothing to bucket aside from charged bullets. Better than airdodging but don\'t miss if you\'re off stage. Bullets aren\'t very useful on stage.</li>\x0A<li>The longer she is in the air using specials the more landing lag she has. Try to capitalize on this.</li>\x0A<li>First witch time is the strongest then it stales after each use until she dies. Length of it depends on how well it is timed.</li>\x0A<li>Dthrow 9 does\'t work since she has a frame 1 air dodge.</li>\x0A</ul>\x0A<h1>Stages</h1>\x0A<h2>Battlefield</h2>\x0A<ul>\x0A<li>Combo extensions are invaluable on this stage.</li>\x0A<li>You can live longer and it\'s much harder for her to land.</li>\x0A<li>Stage control is much easier to keep on this stage.</li>\x0A<li>High blast zone so she can\'t kill you as early with a combo and more time to get out of it.</li>\x0A</ul>\x0A<h2>Final Destination</h2>\x0A<ul>\x0A<li>Neutral stage. Neither character gets much.</li>\x0A</ul>\x0A<h2>Town and City</h2>\x0A<ul>\x0A<li>Platform extensions do too much damage or kill</li>\x0A<li>Blastzones are close to ledge so I die earlier.</li>\x0A<li>I don\'t get much off platforms on this stage.</li>\x0A<li>Large stage makes it easier for her to camp.</li>\x0A</ul>\x0A<h2>Smashville</h2>\x0A<ul>\x0A<li>Harder for her to side b</li>\x0A<li>Safe from dair under the platform.</li>\x0A<li>Harder for her to aerial when under the platform.</li>\x0A</ul>\x0A<h2>Pokemon Stadium 2</h2>\x0A<ul>\x0A<li>Decent stage but it\'s large and gives her space to run.</li>\x0A<li>Ledges are close to blast zones so she kills earlier there.</li>\x0A<li>Stage control is key here as well though she can use the platforms for mixups.</li>\x0A</ul>\x0A<h2>Yoshi\'s Story</h2>\x0A<ul>\x0A<li>Both characters benefit on this stage. Though you can kill her much earlier than she can kill you if you stay grounded and hold center stage.</li>\x0A<li>Avoid platforms since they can get you killed if she combos you off them.</li>\x0A<li>Catch landings with up air or nair.</li>\x0A</ul>\x0A<h2>Lylat</h2>\x0A<ul>\x0A<li>Side B is really good.</li>\x0A<li>Harder to land because of platforms.</li>\x0A<li>Harder to land with aerials overall.</li>\x0A</ul>\x0A<h2>Kalos</h2>\x0A<ul>\x0A<li>You get to live very long and she has more distance to cover for her combos.</li>\x0A<li>She can camp you out since it\'s a large stage so try to keep a lead.</li>\x0A<li>Her kill options are all less effective.</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 4668377, Field1: makeNimstrLit("ike"), Field2: []}, {Field0: -1769217575, Field1: makeNimstrLit("wii_fit_trainer"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1972240864, Field1: makeNimstrLit("lucas"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 2014143459, Field1: makeNimstrLit("ivysaur"), Field2: []}, {Field0: 1503144420, Field1: makeNimstrLit("dark_samus"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 509666534, Field1: makeNimstrLit("shulk"), Field2: []}, {Field0: -167218969, Field1: makeNimstrLit("zelda"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -2017320215, Field1: makeNimstrLit("pichu"), Field2: []}, {Field0: -931379734, Field1: makeNimstrLit("isabelle"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -2106880785, Field1: makeNimstrLit("ken"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1811961871, Field1: makeNimstrLit("palutena"), Field2: makeNimstrLit("<h2>General gameplan and tips</h2>\x0A<p><strong>Do not jump in neutral</strong> vs. Palutena unless it\'s being used to punish her movement.</p>\x0A<p>In neutral, try running underneath her jumps and hold shield.\x0AThis is an attempt to make her mis-space aerials, so we can use up b.</p>\x0A<p>If they space it well, our up b won\'t connect. However, many Palutena players will dash back (or jump back) after. This means we can either chase them with a grab, or a nair.</p>\x0A<p>When they are at kill %, instead of grab or nair, we can dash -&gt; ftilt for the kill.</p>\x0A<p>Crouching in neutral can be really powerful, as it can make her fair, bair, grab, and dash attack all miss.\x0AGrab and dash attack hitting our crouch is inconsistent (depends on our animation hurtbox shifting).</p>\x0A<p>Shield camping in neutral can work very well vs. many Palutena players. Run up -&gt; shield all game.</p>\x0A<p>If she uses down tilt on your shield point blank, you can drop shield -&gt; dash attack or down tilt.</p>\x0A<h2>Situations to look out for</h2>\x0A<ul>\x0A<li>When you\'re at kill % at a distance, often when in the air, Palutena will try using explosive flame (side b) for an early kill. They will try to use this to catch you using dair off stage, landing on stage with an aerial, etc.</li>\x0A<li>They will try to 2 frame you with down tilt at ledge into bair. Down tilt is active for 14 frames, so it\'s INCREDIBLY easy to 2 frame us. The downside of the move, is that it starts on frame 14, so <strong>they can\'t react to our up b</strong>. To avoid this situation, wait until you see down tilt start, then use up b. Be prepared to go super low, and air dodge to ledge if needed.</li>\x0A<li>If you preemptively up b past her down tilt, we can punish it with dair. Her down tilt is laggy.</li>\x0A<li>If we get hit by down tilt or down throw, <strong>DI AWAY</strong> so the back air won\'t connect. DI up and away might be better, untested.</li>\x0A</ul>\x0A<h2>Edge guarding / Ledge trapping</h2>\x0A<p>Typically, you\'ll want to throw bacon at her when she\'s off stage. Be careful of her using side b to hit you using chef, this can kill you.</p>\x0A<p>When she\'s at kill %, you can start baiting her to teleport from a poor position by throwing only 1 bacon, then chasing her off stage with bair. The startup animation of her teleport has 15 frames where you can still hit her (1/4th of a second, or 250 milliseconds).</p>\x0A<h2>Disadvantage</h2>\x0A<ul>\x0A<li>Make use of fast-fall neutral air dodge to avoid her up air trains.</li>\x0A<li>Don\'t burn your double jump when getting juggled!</li>\x0A</ul>\x0A<h2>Stage bans</h2>\x0A<ul>\x0A<li>Town and City</li>\x0A<li>Kalos</li>\x0A</ul>\x0A")}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 1945547256, Field1: makeNimstrLit("pyra"), Field2: makeNimstrLit("<h2>General gameplan and tips</h2>\x0A<p>Pythra\xE2\x80\x99s disjoints beat G&amp;W pretty hard, but Aegis has a pretty bad disadvantage state, particularly landing and recovering.\x0AIf you can gimp Aegis, you win.</p>\x0A<p>In neutral camp Pyra out. If she gets to hit you you lose.</p>\x0A<p>Focus on their habits when they recover, it\xE2\x80\x99s a bit linear but they can mix it up with swap.\x0ALuckily, bair is long lasting enough to last through swap.</p>\x0A<p>If you put them in a situation where they have to Photon Edge to recover, you can use up b to send them further off stage.\x0ASee <a href=\"https://youtu.be/MWSPUz2iMSI?t=1277\" target=\"_blank\">this video timestamp</a> of Miya using up b against Mythra\'s side b.</p>\x0A<p>They are a bait and punish character (especially Mythra, Pyra is more of a Waller) too but Mythra significantly outspeeds G&amp;W so you can\xE2\x80\x99t really camp her out. Remember the neutral triangle (Bait and punish beats poking, overshooting beats B&amp;P, poking beats overshooting). Keep Aegis in disadvantage for as long as possible, juggling and ledgetrapping them to hell. Pyra F Tilt is safe on G&amp;W shield if spaced properly so don\xE2\x80\x99t contest that. If Pyra is above you on a platform, beware of her dair.</p>\x0A<p>When landing, stay the hell away from them.</p>\x0A<p>The key in neutral is seriously just better bait and punish, overshooting and poking. Don\xE2\x80\x99t grab movement, only grab whiffs (that\xE2\x80\x99s universal but it\xE2\x80\x99s especially true with Mythra. However, it\xE2\x80\x99s a bit weird. Foresight activation frames lasts from frames 2-7, but grabs don\xE2\x80\x99t activate Foresight, so she can be grabbed until Frame 8).</p>\x0A")}, {Field0: 2006991609, Field1: makeNimstrLit("mr_game_and_watch"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: -1562944261, Field1: makeNimstrLit("dark_pit"), Field2: []}, {Field0: -897441285, Field1: makeNimstrLit("rosalina_and_luma"), Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}, {Field0: 0, Field1: [], Field2: []}], counter: 89}];
